pragma solidity ^0.4.21;

import "./zeppelin/SafeMath.sol";
import "./zeppelin/Ownable.sol";
import "./zeppelin/ERC20.sol";


contract Redemption is ERC20, Ownable {

    using SafeMath for uint256;

    struct RedemptionStruct {
        address redeemer;
        string location;
        uint256 amount;
        uint256 timestamp;
    }

    RedemptionStruct[] redemptions;
    event RedeemEvent(address _redeember, uint256 _amount, uint256 _timestamp);

    function redeem(uint256 _value, string _location) public returns (uint) {
        require(balanceOf(msg.sender) >= _value);

        approve(msg.sender, _value);
        transferFrom(msg.sender, this, _value);

        RedemptionStruct memory redemption = RedemptionStruct({
            redeemer: msg.sender,
            amount: _value,
            location: _location,
            timestamp: now
        });

        redemptions.push(redemption);

        emit RedeemEvent(redemption.redeemer, redemption.amount, redemption.timestamp);
    }

    function approveRedemption(uint256 _index) public onlyOwner {
        require(redemptions[_index].amount >= 0);

        RedemptionStruct memory redemption = redemptions[_index];
        // destroyTokens(redemption.amount);

        redemptions[_index] = redemptions[redemptions.length-1];
        redemptions.length--;
    }

    function declineRedemption(uint256 _index) public onlyOwner {
        require(redemptions[_index].amount >= 0);

        RedemptionStruct memory redemption = redemptions[_index];
        transfer(redemption.redeemer, redemption.amount);

        redemptions[_index] = redemptions[redemptions.length-1];
        redemptions.length--;
    }

    function getRedemptionsLength() public constant onlyOwner returns (uint) {
        return redemptions.length;
    }

    function getRedemption(uint256 _index) public constant onlyOwner returns (address, uint, string, uint) {
        RedemptionStruct memory redemption = redemptions[_index];
        return (
            redemption.redeemer,
            redemption.amount,
            redemption.location,
            redemption.timestamp
        );
    }

}
